/** MY OWN DEBBUGUER SYSTEM **/
function doDebug($debugIn = null, $dumpFormat = false, $error = true){
	
  // Specify a path to save debug error output
  $debugFile = "/home/public_html/aplication/error.log";
	
  // Saving File
	$debug = fopen($debugFile, "a") or die("Log Error.");
	if (is_array($debugIn) && $dumpFormat == false){
		$debugIn = print_r($debugIn, true);
	}
	if ($dumpFormat == true){
		ob_start();
		var_dump($debugIn);
		$debugIn = ob_get_clean();
	}
	fwrite($debug, $debugIn . "\n");
	fclose($debug);
	
  // Creating notification message
	$headers[] = 'MIME-Version: 1.0';
	$headers[] = 'Content-type: text/html; charset=iso-8859-1';
	$headers[] = 'From: Ciclon Experience <webservice@ciclon.com.ec>';
	
	$message = '<div style="width:300px;height:fit-content;background-color:#cce6ff;border-radius:7px;padding:20px 20px 20px 20px;">';
	$message .= '<center><img src="data:image/png;base64," ></center>';
	$message .= '<h2 style="color:#471800;text-align:center;">Webservice Notification</h2>';
	$message .= ($error == true ? '<p>Error detect.</p>' : '<p>New Data.</p>');
	$message .= '<h3>Detail: </h3>';
	$message .= ($error == true ? '<p style="color:red;">' : '<p style="color:green;">');
	$message .= $debugIn;
	$message .= '</p>';
	$message .= '<span>Atte.</span><br/>';
	$message .= '<span>Administration</span>';
	$message .= '</div>';
	
	$subject = ($error == true ? 'Alert! - Webservice Error' : 'Notification! - Webservice Activity');
	mail( "admin@phpwebservice.com" , "Alert! - Webservice Error" , $message, implode("\r\n", $headers));
}

// Ten digits validation Text
public function validId($id){
	$validToken = '/^([0-9]{10})$/';
	$strID = strval($id);
	if(preg_match($validToken, $strID)){
		return true;
	}else{
		return false;
	}
}
